  true,\n\t\"url\": null,\n\t\"notes\": \"HIR3SCOL is the EOS High Resolution Dynamics
  Limb Sounder (HIRDLS/Aura) level 3 daily gridded 1 x 1 deg. stratospheric columns
  of NO2 (nitrogen dioxide) data product. The current version is 7. The product contains
  1 x 1 degree gridded data between +80 to -64 degrees latitude. The stratospheric
  column is computed from data at 57 to 1.0 hPa. The product consists of one file
  spanning the entire HIRDLS mission from January 22, 2005 through March 17, 2008.
  Users of the HIR3SCOL data product should read the Version 7 HIRDLS Data Description
  and Quality document for more informationnnThe data are stored in the version 5
  EOS Hierarchical Data Format (HDF-EOS5), which is based on the version 5 Hierarchical
  Data Format, or HDF5. The data file contains one grid object with data fields, attributes,
  and metadata. The data fields include the stratospheric column amount, precision
  (standard deviation), and data counts per grid cell. Time, latitude and longitude
  information are also included in the file.nnParameters contained in the data files
  include the following:nVariable Name|Description|UnitsnNO2|Nitrogen Dioxide (NO2)
  Volume Mixing Ratio|mol/molnEnd of parameter information\",\n\t\"license_title\":
